import React, { Component } from 'react';
import { Row, Col } from 'reactstrap';
import './App.scss';
import WeatherDisplay from '../WeatherDisplay';

class App extends Component {
    render() {
        return (
            <div>
                <Row>
                    <Col>
                        <WeatherDisplay
                            className="main-display"
                        />
                    </Col>
                </Row>
            </div>
        )
    }
};

export default App;
